Sprzedam Toyote Avensis T25 2.0 VVTI 2004r. Przebieg 296tys km. 



Auto w moich rękach 2lata i przez ten czas ani razu mnie nie zawiódł. Na wyposażeniu:

- elektryczne skladane i sterowane lusterka

- lusterko wewnetrzne wsteczne fotochromatyczne;

- klimatronic (klima w pełni sprawna);

- wielofunkcyjna skorzana kierownica (niestety na wiosnę przetarła się skóra w jednym miejscu);

- wykończenia wewnetrzne ala drewno;

- wszystkie szyby w prądzie; 

- isofix. 

- hak holowniczy (oczywiście wbity w dowod). 



Auto jak na swoje lata prezentuje się naprawdę dobrze, silnik ma moc, wszystko jest sprawne. W marcu tego roku wpadl nowy komplet tarcz (przod i tyl) wraz z klockami + wymiana oleju z filtrami. Niestety znajdą się tez pewne mankamenty jak pojawiające ogniska rdzy przy podszybiu. Kilka dni temu pojawiła się nieszczelność w układzie wydechowym. Podejrzewam, że kolektor wydechowy musiał gdzieś przerdzewiec i puscic, bo dmucha z okolic silnika. Mocy auto nie straciło. Przeglad na rok, OC do 20.08. 



Jestem pewny tego auta, wiem ze po ogarnięciu tej nieszczelności jeszcze się ktos nim nacieszy. Proszę nie dzwonić ze śmiesznymi ofertami, nie marnujmy sobie czasu :) Samochód do obejrzenia w Radzyminie. Niestety z racji na moj wyjazdowy tryb pracy auto można zobaczyć od czwartku do poniedziałku włącznie z weekendem. Auto sprzedaje na felgach stalowych 16' z oponami zimowymi. Mam zestaw letni felg 16' widoczny na zdjęciach z nowymi oponami, które zakupiłem i założyłem w czerwcu tego roku - możemy spróbować się dogadać w tej kwestii ;) 



*Cena do rozsądnej negocjacji.
